import React, { useState, useEffect } from 'react';
import {GiAbstract086} from 'react-icons/gi'

const Work = ()=>{
    const [appList,setappList] = useState([])
    useEffect(async() => {
        console.log('sent the req.')
        const data = await fetch("/blockedApps")
        const res = await data.json()
        console.log(res);
        setappList(res);
      },[]);
    return(
        <>
        <div className='row'>
            <div className='col-lg-6'>
                <h4>Blocked Apps - count</h4>
                <div className='appsList mt-4'>
                {appList.map((item)=>{
                        return (
                            <div>
                                <p><GiAbstract086 className='symbol'/>{item['app_name']}</p><hr/>
                            </div>
                            )
                    })}
                </div>
            </div>
            <div className='col-lg-6'>
                <h4>Other Installed apps -count</h4>
                <div className='appsList mt-4'>
                    {/* maps the array of blocked apps here */}
                    
                    {/* <p><GiAbstract086 className='symbol'/>  Pubg</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Fortnite</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Amazon</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Gpay</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Gpay</p><hr/> */}
                </div>
            </div>
        </div>

        </>

    )
}

export default Work;
